import Link from "next/link"
import Head from "next/head"
import logo from "../assets/exam.png"
export default ({loggedIn, accountName, userID}) => (
    <div className="main">
        <Head>
            <link href="https://fonts.googleapis.com/icon?family=Material+Icons" rel="stylesheet" />
        </Head>
            <Link href="/upload">
                <a className="flex">
                    <i class="material-icons flex">file_upload</i>
                </a>
            </Link>
            {loggedIn ? <Link href={`/user/${userID}`}><a>{accountName}</a></Link> : null}
            {!loggedIn ? <Link href="/login"><a>Login</a></Link> : null}
            {!loggedIn ? <Link href="/signup"><a>Sign up</a></Link> : null}

    <style jsx>{`
        .main {
            display: flex;
            flex-direction: row;
            justify-content: flex-end;
            align_items: center;
            height: 4rem;
            background: rgb(0,0,0);
        }

        .logo {
            position: absolute;
            top: .65rem;
            left: .5rem;
            width: 32px;
            height: 32px
        }

        a {
            text-decoration: none;
            color: rgb(255,255,255);
            font-size: 1.3rem;
        }

        a:hover {
            color: rgb(222, 218, 217);
        }

        .flex {
            display: flex;
            width: 24px;
            justify-content: center
        }

    `}</style>
    </div>
)
